window.bookSummaryJSON = "<p>It's three weeks until Pyper Rayne and her fiancé Julius tie the knot. All she wants to do is enjoy her risqué bridal shower, complete the final details of her wedding, and find time to enjoy the holidays. But when Charlie, the manager of Wicked, is arrested for a murder she didn't commit, Pyper puts her medium skills to the test in order to find the real killer before Charlie takes the fall. </p> <p>With help from her friends, a couple of shih tzus, and more than a few ghosts, can Pyper save the day and get her happily-ever-after?</p>"; 
